      "source": [
        "##Agebins and Survival\n",
        "##Converting Age into 4 different bins \n",
        "data$under50=as.factor(ifelse(data$age<=50,1,0)) ##Patients with age less than 50\n",
        "data$under70=as.factor(ifelse(data$age<=70 & data$age>50,1,0))##Patients with age between 50 and 70\n",
        "data$under90=as.factor(ifelse(data$age<=90& data$age>70,1,0))##Patients with age between 70 and 90\n",
        "data$over90=as.factor(ifelse(data$age>90,1,0))##Patients with age over 90\n"
      ],
      "execution_count": 6,
      "outputs": []
    },
