      "source": [
        "##T-Score and Survival \n",
        "\n",
        "t=table(data$survival_7_years,data$t_score)\n",
        "prtb=prop.table(t)*100\n",
        "barplot(prtb,col=c(\"steelblue\",\"orange\"))\n",
        "##There is a likely relation between each groups of t_score and Survival and \n",
        "##we need to check the t_score significance using statistical tests"
