      "source": [
        "##Height and Survival \n",
        "\n",
        "boxplot(data$weight~data$survival_7_years,col=c(\"steelblue\",\"orange\"))\n",
        "boxplot(data$height~data$survival_7_years,col=c(\"steelblue\",\"orange\"))\n",
        "##Height and Weight has no significance with the output and hence we go for BMI\n",
        "\n",
        "##Creating a new column BMI to test if it has any significance on Target\n",
        "data$BMI=data$weight/(data$height^2)*703\n",
        "\n",
        "boxplot(data$BMI~data$survival_7_years,col=c(\"steelblue\",\"orange\"))\n",
        "##Even BMI does not look like exerting its influence over the target\n",
        "##Still we depend on statistical test"
