      "source": [
        "##Tumor Size at the time of Diagnois, 6 months, 1year and Tatget\n",
        "\n",
        "boxplot(data$tumor_diagnosis~data$survival_7_years,col=c(\"steelblue\",\"orange\"))\n",
        "boxplot(data$tumor_6_months~data$survival_7_years,col=c(\"steelblue\",\"orange\"))\n",
        "boxplot(data$tumor_1_year~data$survival_7_years,col=c(\"steelblue\",\"orange\"))\n",
        "##We can see that the tumor size after 6 months and 1 year from the date of dignosis is slightly higher for those who didnt survive compared to those who survived\n",
        "##We can confirm this using statistical tests"
