        "**Statistical Tests to Identify the Significance**"
      ]
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "3Kgq_TGECCyX",
        "colab_type": "code",
        "colab": {
          "base_uri": "https://localhost:8080/",
          "height": 1000
        },
        "outputId": "34faa989-cb08-414a-8d30-ee96f3e9372b"
      },
      "source": [
        "##Chi Squared tests for all the Factor-Factor relationship\n",
        " chisq.test(data$survival_7_years,  data$t_score          ) \n",
        " chisq.test(data$survival_7_years,  data$n_score          )         \n",
        " chisq.test(data$survival_7_years,  data$m_score          )   \n",
        " chisq.test(data$survival_7_years,  data$stage            )   \n",
        "\t\t\t\t\t\t\t\t\t\t\t\t\t\t\n",
        " chisq.test(data$survival_7_years,  data$race             )   \n",
        "\t\t\t\t\t\t\t\t\t\t\t\t\t\t\n",
        " chisq.test(data$survival_7_years,  data$family_history   )   ##Has No SIgnificance and this variable can be removed \n",
        "\t\t\t\t\t\t\t\t\t\t\t\t\t\t  \n",
        " chisq.test(data$survival_7_years,  data$previous_cancer  )   \n",
        " chisq.test(data$survival_7_years,  data$smoker           )   ##Smoking also does not affect the target and can be removed\n",
        " chisq.test(data$survival_7_years,  data$side             )   ##Side of the cancer does not have any impact and being removed\n",
        "\t\t\t\t\t\t\t\t\t\t\t\t\t\t\n",
        " chisq.test(data$survival_7_years,  data$tea              )   ##Tea has no significance and can be removed \n",
        " chisq.test(data$survival_7_years,  data$symptoms         )   ##Variable Symptom has to be treated in a different way \n",
        " chisq.test(data$survival_7_years,  data$rd_thrpy         )   \n",
        " chisq.test(data$survival_7_years,  data$h_thrpy          )   \n",
        " chisq.test(data$survival_7_years,  data$chm_thrpy        )   \n",
        " chisq.test(data$survival_7_years,  data$cry_thrpy        )   \n",
        " chisq.test(data$survival_7_years,  data$brch_thrpy       )   \n",
        " chisq.test(data$survival_7_years,  data$rad_rem          )   \n",
        " chisq.test(data$survival_7_years,  data$multi_thrpy      )   \n",
        " chisq.test(data$survival_7_years,  data$survival_1_year  )   \n",
        " chisq.test(data$survival_7_years,  data$under50  )  ##None of the age bins explains any variance of the Survival target\n",
        " chisq.test(data$survival_7_years,  data$under70  ) \n",
        " chisq.test(data$survival_7_years,  data$under90  ) \n",
        " chisq.test(data$survival_7_years,  data$over90  ) \n",
        " chisq.test(data$survival_7_years, data$first_degree_history)\n",
        "##All the other variables are statically significant at 95% confidence interval  and are chosen for the model. "
      ],
