      "source": [
        "**Checking for Multicollinearity between Independent variables, Since there are some variables like Tumor_1_Month,Tumor_6_month which might have higher collinearity**"
      ]
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "ORbcQZBCQTRC",
        "colab_type": "code",
        "colab": {
          "base_uri": "https://localhost:8080/",
          "height": 556
        },
        "outputId": "c01e3481-0796-4ec3-db81-65db88cf2d96"
      },
      "source": [
        "##We care about Multicollinearity because it affects the interpretability of our Model.\n",
        "##If we just want to predict the results with higher Accuracy then we do not need to care about Multicollinearity\n",
        "##Since we are looking for interpretabilty as well we look for highly collinear variables\n",
        "\n",
        "intgvar=data[,c('gleason_score','tumor_diagnosis','tumor_1_year','psa_diagnosis','psa_1_year','BMI')]\n",
        "str(intgvar)\n",
        "pairs(intgvar)\n",
        "##We can see there is some slight collinearity between tumor_dignosis and tumor_1_year but still we will\n",
        "##examine it using VIF\n"
      ],
      "execution_count": 24,
      "outputs": [
        {
          "output_type": "stream",
          "text": [
            "'data.frame':\t8002 obs. of  6 variables:\n",
