            " $ tumor_1_year   : int  39 16 62 0 58 0 33 93 0 25 ...\n",
            " $ psa_diagnosis  : num  8.7 13.7 12.3 4.4 9.7 9.8 16.7 11.8 5.2 8.1 ...\n",
            " $ psa_1_year     : num  4.2 7.5 12.7 0.7 8.3 2.1 13.9 11.5 0 4.1 ...\n",
            " $ BMI            : num  25.5 25 24.5 26 24.8 ...\n"
          ],
          "name": "stdout"
        },
        {
