      },
      "source": [
        "**Solving Multicollinearity:**\n",
        "To handle Multi collinearity we can handle follwing two methoods.\n",
        "1. Using Variance Inflation Factor\n",
        "2. Using Stepwise regression to eliminate insignificant variables and add significant variables with reduced AIC (Akaike Information Criteria).\n",
        "\n",
        "But in this case we use Regularization to penalize the variables"
      ]
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "G1Rr16E4YCGw",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "##Regularization Begins\n",
        "##Creating a matrix with train variables for LASSO and RIDGE\n",
        "\n",
        "Y=data[c(20)]\n",
        "\n",
        "X=model.matrix( survival_7_years ~.,data = data)\n",
        "\n",
        "\n",
        "\n",
        "#Splitting the data into test and train\n",
        "\n",
        "\n",
        "##Train - Test Split\n",
        "set.seed(75657)\n",
        "indx=sample(2,nrow(X),replace=TRUE,prob=c(0.80,0.20))\n",
        "train_X=X[indx==1,]\n",
        "test_X=X[indx==2,]\n",
        "\n",
        "train_Y=Y[indx==1,]\n",
        "test_Y=Y[indx==2,]"
      ],
      "execution_count": 30,
      "outputs": []
    },
    {
      "cell_type": "markdown",
      "metadata": {
        "id": "w18K9jssJpGl",
        "colab_type": "text"
      },
      "source": [
        "**Ridge Regression**"
      ]
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "B48MJ3JIJEa2",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "##Cross validation to get a good value of Lambda usually 10 - fold Cross Validation\n",
        "\n",
        "library(glmnet)\n",
        "cvglmnetridge=cv.glmnet(train_X, train_Y,type.measure = \"class\", alpha=0,family='binomial')\n",
        "##We use  class as an evaluation parameter to get Lambda since we are performing classification\n",
        "##Binomial for Logistic and Gaussian for Linear Regression"
      ],
      "execution_count": 31,
      "outputs": []
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "tRhZ7_iLMSrX",
