        },
        "outputId": "11d51bbf-a6fa-4a20-cb20-684e094d9c4c"
      },
      "source": [
        "plot(cvglmnetridge)\n",
        "##Getting the best lambda we can also take the minimum lamnda value\n",
        "s=cvglmnetridge$lambda.1se\n",
        "plot(cvglmnetridge$glmnet.fit,xvar = 'lambda',label = T)\n",
        "##We can see how coeddficients decrease with increase in Lambda"
