      },
      "source": [
        "##We can either use s as Lambda.min or Lambda.1se since for comparison purpose we use lamda.1se\n",
        "##Training the Ridge model using best Lambda value\n",
        "ridge=glmnet(train_X,train_Y,family = 'binomial',alpha=0,lambda = s)\n"
      ],
      "execution_count": 33,
      "outputs": []
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "hbGeGEz5N_wG",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "##Predict Using the trained Ridge Model\n",
        "\n",
        "ridgepredict=predict(ridge, s=s,newx = test_X,type = 'response')\n",
        "predicted=as.factor(ifelse(ridgepredict>=0.5,1,0))"
      ],
      "execution_count": 34,
      "outputs": []
    },
