      "source": [
        "**LASSO Regularization**"
      ]
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "RtXXIwFfjeTB",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "##Cross validation to get a good value of Lambda usually 10 - fold Cross Validation\n",
        "\n",
        "library(glmnet)\n",
        "cvglmnetlasso=cv.glmnet(train_X, train_Y,type.measure = \"class\", alpha=1,family='binomial')\n",
        "##We use  class as an evaluation parameter to get Lambda since we are performing classification\n",
        "##Binomial for Logistic and Gaussian for Linear Regression"
      ],
      "execution_count": 41,
      "outputs": []
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "dCswdJwk0oGn",
        "colab_type": "code",
        "colab": {
          "base_uri": "https://localhost:8080/",
          "height": 857
        },
        "outputId": "d72e4691-d4ba-4bfe-c759-94c3d6852961"
      },
      "source": [
        "plot(cvglmnetlasso)\n",
        "##Getting the best lambda we can also take the minimum lamnda value\n",
        "s=cvglmnetlasso$lambda.1se\n",
        "plot(cvglmnetlasso$glmnet.fit,xvar = 'lambda',label = T)\n",
        "##We can see how coeddficients decrease with increase in Lambda\n",
        "##We can also see how many variables getting decreased from 38 to 0 with increase in Lambda"
      ],
      "execution_count": 42,
      "outputs": [
        {
