      "source": [
        "Both Our Lasso and Ridge only gave about 66% accuracy, In order for a higher Accuracy we could try with an Extreme Gradient Boosting Model which could boost accuracy significantly.\n",
        "\n",
        " **EXTREME GRADIENT BOOSTING**"
      ]
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "R0tbdHnu5fcf",
        "colab_type": "code",
        "colab": {
          "base_uri": "https://localhost:8080/",
          "height": 68
        },
        "outputId": "c54a257b-1e86-407e-f08d-f4df932e26e0"
      },
      "source": [
        "install.packages('xgboost')\n",
        "install.packages('dplyr')\n",
        "install.packages('Matrix')\n",
        "install.packages(\"xgboost\")\n",
        "library(xgboost)\n"
      ],
      "execution_count": 49,
      "outputs": [
        {
          "output_type": "stream",
