        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "set.seed(3464)\n",
        "part=sample(2,nrow(data),replace=TRUE,prob = c(0.75,0.25))\n",
        "\n",
        "train=data[part==1,]\n",
        "test=data[part==2,]"
      ],
      "execution_count": 52,
      "outputs": []
    },
    {
      "cell_type": "markdown",
      "metadata": {
        "id": "dpsiewjH8MFc",
        "colab_type": "text"
      },
      "source": [
        "**Create  Matrix - One hot Encoding **"
      ]
    },
    {
      "cell_type": "code",
      "metadata": {
        "id": "1AYs4lbT8TDr",
        "colab_type": "code",
        "colab": {}
      },
      "source": [
        "trainm=sparse.model.matrix(survival_7_years~.-1,data=train)\n",
        "train_label=as.numeric(train[,\"survival_7_years\"])\n",
        "train_matrix=xgb.DMatrix(data=as.matrix(trainm),label=train_label)"
      ],
      "execution_count": 75,
      "outputs": []
    },
